//src/app.js
import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import Login from "./components/Login";
import ContentCreation from "./components/ContentCreation";
import Register from "./components/Register";
import Survey from "./components/Survey";
import Connect from "./Connect";

const App = () => {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (token) {
      setUser({ username: localStorage.getItem("username") || "admin" });
    }
  }, []);

  const handleLogin = (userData) => {
    setUser(userData);
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("username");
    localStorage.removeItem("appUser");
    setUser(null);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/login"
          element={
            user ? <Navigate to="/connect" /> : <Login onLogin={handleLogin} />
          }
        />
        <Route
          path="/register"
          element={user ? <Navigate to="/connect" /> : <Register />}
        />

        <Route path="/survey" element={<Survey />} />

        <Route
          path="/connect"
          element={
            user ? (
              <div>
                <div style={{ position: "absolute", top: 10, right: 10, zIndex: 1000 }}>
                  <button
                    onClick={handleLogout}
                    style={{
                      padding: "0.5rem 1rem",
                      backgroundColor: "#facc15",
                      color: "#1f2937",
                      border: "none",
                      borderRadius: "0.5rem",
                      cursor: "pointer",
                      fontWeight: "600",
                    }}
                  >
                    Logout
                  </button>
                </div>
                <Connect />
              </div>
            ) : (
              <Navigate to="/login" />
            )
          }
        />

        {/* Changed from /content to /content-creation */}
        <Route
          path="/content-creation"
          element={
            user ? (
              <div>
                <div style={{ position: "absolute", top: 10, right: 10, zIndex: 1000 }}>
                  <button
                    onClick={handleLogout}
                    style={{
                      padding: "0.5rem 1rem",
                      backgroundColor: "#facc15",
                      color: "#1f2937",
                      border: "none",
                      borderRadius: "0.5rem",
                      cursor: "pointer",
                      fontWeight: "600",
                    }}
                  >
                    Logout
                  </button>
                </div>
                <ContentCreation user={user} />
              </div>
            ) : (
              <Navigate to="/login" />
            )
          }
        />

        {/* Add placeholder routes for other pages referenced in Connect.js */}
        <Route 
          path="/schedule" 
          element={user ? <div style={{ padding: '2rem' }}>Schedule Page - Coming Soon</div> : <Navigate to="/login" />} 
        />
        <Route 
          path="/analytics" 
          element={user ? <div style={{ padding: '2rem' }}>Analytics Page - Coming Soon</div> : <Navigate to="/login" />} 
        />
        <Route 
          path="/my-posts" 
          element={user ? <div style={{ padding: '2rem' }}>My Posts Page - Coming Soon</div> : <Navigate to="/login" />} 
        />
        <Route 
          path="/profile" 
          element={user ? <div style={{ padding: '2rem' }}>Profile Page - Coming Soon</div> : <Navigate to="/login" />} 
        />
        <Route 
          path="/settings" 
          element={user ? <div style={{ padding: '2rem' }}>Settings Page - Coming Soon</div> : <Navigate to="/login" />} 
        />

        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </Router>
  );
};

export default App;
